import logo from './cyber-security.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Devendra K Meena, an aspiring Cybersecurity Professional
        </p>
        <a
          className="App-link"
          href="#"
          target="_blank"
          rel="noopener noreferrer"
        >
          Website In Progress
        </a>
      </header>
    </div>
  );
}

export default App;
